import React from 'react';

const peicecount = ({ videos }) => {
// console.log(videos);
const videosPieces = videos.map(video => { return video.PIECES});
console.log(`video pieces ${videosPieces}`);
const reducer = (previousValue, currentValue) => previousValue + currentValue;

const numberOfPieces = (typeof videosPieces !== 'undefined' && videosPieces.length === 0)? videosPieces.reduce(reducer): 'none';


return (
  <p>Pieces: {numberOfPieces}</p>
  );
};

export default peicecount;
